n, k = map(int,input().split())
t = n // (k * (k + 1) // 2)
if t == 0:
    print(-1)
else:
    i = 1
    u = 1
    while i * i <= n:
        if n % i == 0:
            if i <= t and i > u:
                u = i
            if n // i <= t and n // i > u:
                u = n // i
        i += 1
    for i in range(1, k):
        print(u * i, end = ' ')
    print(n - (u * (k * (k - 1))//2))
